import React, {useState} from "react";
import { Link } from "react-router-dom";
import styles from "../styles/navBar.module.css";
import logo from "../styles/img/boton.png";
import SearchBar from "./SearchBar";
import menu from "../styles/img/menu.png";

const NavBar = () => {
  const [showMenu, setShowMenu] = useState(false);

  const handleMenuClick = () => {
    setShowMenu(!showMenu);
    const menuContainer = document.querySelector(`.${styles.menuContainer}`);
    menuContainer.classList.toggle(styles.showMenu);
  };


  return (
    <>
      <nav className={styles.nav}>
        <Link to="/">
          <img className={styles.logo} src={logo} alt="logo"></img>
        </Link>

        <h1>Lista de razas</h1>
        <SearchBar></SearchBar>

        <button className={styles.btnMenu} onClick={handleMenuClick}>
          <img className={styles.menu} src={menu} alt=""></img>
        </button>
      </nav>
      {showMenu && (
        <div className={styles.menuContainer}>
          <ul className={styles.menuList}>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/contact">Contact</Link>
            </li>
          </ul>
        </div>
      )}
    </>
  );
};

export default NavBar;
